import React, { useContext } from 'react'
import trexImg from '../assets/t-rex.png'
import { userContext } from '../userContext'

export const Home = () => {

    const user = useContext(userContext)
    let post;

    user.data ? post = (
        <section className='mt-20'>
            <h1 className=' text-5xl font-semibold mb-20'>Welcome {user.name}</h1>
            <h3 className='text-3xl font-normal'>How are you doin today?</h3>
        </section> 
    ) : post = (
        <section className='flex justify-center items-center'>
            <h1 className='text-5xl'>Please login</h1>
        </section>
    )

    return (
        <div className='grid grid-cols-2'>
            <section>
                <img src={trexImg} alt='t-rex'/>
            </section>

            {post}
        </div>
    )
}
